import styled from 'styled-components';

export const LinkingWrapper = styled.div`
.selected {
    :after {
        content: '';
        display: block;
        position: absolute;
        bottom: -5px;
        left: 50%;
        height: 16px;
        border-left: 1px solid black;
    }





}

`
